// Cache Check - Same as Standard tier
if (typeof global.suggestionCacheEnterprise === 'undefined') global.suggestionCacheEnterprise = {};
if (typeof global.processingRequestsEnterprise === 'undefined') global.processingRequestsEnterprise = {};
if (typeof global.newestRequestsEnterprise === 'undefined') global.newestRequestsEnterprise = {};
if (typeof global.metricsEnterprise === 'undefined') {
  global.metricsEnterprise = { total: 0, hits: 0, misses: 0, waits: 0 };
}

const webhookData = $input.first().json;
const body = webhookData.body || webhookData;

const sessionId = body.session_id || 'unknown';
const cartHash = body.cart_hash || 'unknown';
const requestId = body.request_id || 'unknown';
const customerId = body.customer_id || 'demo';
const cartEmpty = body.cart_empty || false;

const cacheKey = `${sessionId}:${cartHash}`;
const now = Date.now();
const TTL = 300000;
const PROCESSING_TTL = 90000; // Longer for RAG

global.metricsEnterprise.total++;

if (cartEmpty) {
  Object.keys(global.suggestionCacheEnterprise).forEach(k => {
    if (k.startsWith(sessionId + ':')) delete global.suggestionCacheEnterprise[k];
  });
  return { json: { success: false, suggestions: [], _skipProcessing: true, _cacheHit: false } };
}

global.newestRequestsEnterprise[sessionId] = { request_id: requestId, cart_hash: cartHash, timestamp: now };

// Cleanup
Object.keys(global.suggestionCacheEnterprise).forEach(k => {
  if (now - global.suggestionCacheEnterprise[k].timestamp > TTL) delete global.suggestionCacheEnterprise[k];
});
Object.keys(global.processingRequestsEnterprise).forEach(k => {
  if (now - global.processingRequestsEnterprise[k].timestamp > PROCESSING_TTL) delete global.processingRequestsEnterprise[k];
});

const cached = global.suggestionCacheEnterprise[cacheKey];
if (cached && now - cached.timestamp < TTL) {
  global.metricsEnterprise.hits++;
  return { json: { ...cached.data, cached: true, _cacheHit: true, _skipProcessing: true } };
}

const processing = global.processingRequestsEnterprise[cacheKey];
if (processing && now - processing.timestamp < PROCESSING_TTL) {
  global.metricsEnterprise.waits++;
  return { json: { ...webhookData, cacheKey, timestamp: now, _skipProcessing: true, _waitForProcessing: true } };
}

global.processingRequestsEnterprise[cacheKey] = { request_id: requestId, timestamp: now };

return {
  json: {
    ...webhookData,
    cacheKey,
    timestamp: now,
    _skipProcessing: false,
    _sessionId: sessionId,
    _requestId: requestId,
    _customerId: customerId
  }
};

// Wait for processing
const cacheKey = $json.cacheKey;
for (let i = 0; i < 90; i++) {
  await new Promise(r => setTimeout(r, 1000));
  if (global.suggestionCacheEnterprise?.[cacheKey]) {
    const cached = global.suggestionCacheEnterprise[cacheKey];
    return { json: { ...cached.data, cached: true, waited_ms: (i + 1) * 1000 } };
  }
}
return { json: { success: false, suggestions: [], error: 'Timeout' } };

// Build cart text for embedding
const webhookData = $node["Webhook - Cart Info"].json;
const body = webhookData.body || webhookData;
const cartItems = body.cart_items || [];

// Build descriptive text for embedding
const cartText = cartItems
  .map(item => `${item.product_name || item.name} (${item.category || 'unknown'})`)
  .join(', ');

// Get valid product IDs from pre-filter
let validIds = [];
const prefilterNode = $node["Pre-Filter Products"];
if (prefilterNode && prefilterNode.json) {
  if (Array.isArray(prefilterNode.json)) {
    validIds = prefilterNode.json.map(p => p.id);
  } else if (prefilterNode.json.id) {
    validIds = [prefilterNode.json.id];
  }
}

// Also check all inputs for pre-filter results
const allInputs = $input.all();
allInputs.forEach(input => {
  if (input.json && input.json.id && typeof input.json.id === 'number') {
    if (!validIds.includes(input.json.id)) validIds.push(input.json.id);
  }
});

// Exclude cart items from valid IDs
const cartProductIds = cartItems.map(i => i.product_id || i.id);
validIds = validIds.filter(id => !cartProductIds.includes(id));

console.log('[RAG] Cart text for embedding:', cartText);
console.log('[RAG] Valid product IDs for vector search:', validIds.length);

return {
  cartText: cartText,
  cartItems: cartItems,
  cartProductIds: cartProductIds,
  validProductIds: validIds
};

// Merge RAG results with context
const webhookData = $node["Webhook - Cart Info"].json;
const body = webhookData.body || webhookData;
const cartItems = body.cart_items || [];
const cartProductIds = cartItems.map(i => i.product_id || i.id);

// Get weather
let weather = { temp: 20, condition: 'unknown', is_raining: false, is_cold: false };
try {
  const w = $node["Get Weather"].json;
  if (w && w.main) {
    weather = {
      temp: Math.round(w.main.temp),
      condition: w.weather?.[0]?.main || 'unknown',
      is_raining: ['Rain', 'Drizzle', 'Thunderstorm'].includes(w.weather?.[0]?.main),
      is_cold: w.main.temp < 10
    };
  }
} catch (e) {}

// Get purchase history
let purchaseHistory = [];
try {
  const h = $node["Get Purchase History"].json;
  purchaseHistory = Array.isArray(h) ? h : (h?.id ? [h] : []);
} catch (e) {}

// Get vector search results
let vectorResults = [];
try {
  const qdrantResponse = $input.first().json;
  if (qdrantResponse && qdrantResponse.result) {
    vectorResults = qdrantResponse.result.map(r => ({
      id: r.payload?.id || r.id,
      name: r.payload?.name,
      category: r.payload?.category,
      subcategory: r.payload?.subcategory,
      price: r.payload?.price,
      description: r.payload?.description,
      similarity_score: r.score,
      in_stock: true
    }));
  }
} catch (e) {
  console.log('[RAG] Qdrant search failed:', e.message);
}

console.log('[RAG] Vector search returned:', vectorResults.length, 'products');

// Filter out recently purchased and cart items
const recentPurchaseIds = new Set(purchaseHistory.map(h => h.id));
let compatibleProducts = vectorResults
  .filter(p => !cartProductIds.includes(p.id))
  .filter(p => !recentPurchaseIds.has(p.id));

// Add safety products if power tools in cart
const hasPowerTools = cartItems.some(i => {
  const cat = i.category || '';
  return cat.toLowerCase().includes('power') || cat.toLowerCase().includes('tool');
});

// Date context
const now = new Date();
const month = now.getMonth() + 1;
const season = month >= 3 && month <= 5 ? 'spring' : month >= 6 && month <= 8 ? 'summer' : month >= 9 && month <= 11 ? 'autumn' : 'winter';

const contextData = {
  cart_items: cartItems.map(i => ({
    id: i.product_id || i.id,
    name: i.product_name || i.name,
    category: i.category,
    quantity: i.quantity || 1
  })),
  cart_product_ids: cartProductIds,
  cart_total: cartItems.reduce((sum, i) => sum + ((i.price || 0) * (i.quantity || 1)), 0).toFixed(2),
  compatible_products: compatibleProducts,
  weather: weather,
  season: season,
  purchase_history: purchaseHistory.slice(0, 5),
  has_power_tools: hasPowerTools,
  customer_id: body.customer_id || 'demo',
  session_id: body.session_id || 'demo'
};

const ollamaRequest = {
  model: "llama3.2",
  messages: [
    {
      role: "system",
      content: `És um assistente de vendas de ferramentas com acesso a pesquisa semântica de produtos.

PRODUTOS DISPONÍVEIS: Os produtos na lista compatible_products foram selecionados por similaridade semântica ao carrinho.

CONTEXTO:
- Clima: ${weather.temp}°C, ${weather.condition}
- Estação: ${season}
- Ferramentas elétricas no carrinho: ${hasPowerTools ? 'SIM - prioriza segurança!' : 'Não'}

Sugere 5 produtos complementares usando APENAS IDs da lista compatible_products.

RETORNA JSON:
{
  "suggestions": [
    { "product_id": <id>, "product_name": "<nome>", "reason": "<razão>", "confidence": <0.0-1.0> }
  ]
}`
    },
    {
      role: "user",
      content: JSON.stringify(contextData)
    }
  ],
  stream: false,
  format: "json",
  options: { temperature: 0.4, num_predict: 2000 }
};

return { contextData, ollamaRequest };

// Format response with strict validation
const contextData = $node["Merge RAG Context"].json.contextData;

const productMap = {};
contextData.compatible_products.forEach(p => { productMap[p.id] = p; });
const validIds = new Set(contextData.compatible_products.map(p => p.id));

let suggestions = [];
let llmUsed = 'ollama-rag';

try {
  const input = $input.first().json;
  if (input.error) throw new Error(input.error.message);

  let response = input;
  if (input.body) response = typeof input.body === 'string' ? JSON.parse(input.body) : input.body;

  if (response.message?.content) {
    const content = typeof response.message.content === 'string' ? JSON.parse(response.message.content) : response.message.content;
    suggestions = content.suggestions || [];
  }

  const enriched = suggestions
    .map(s => {
      const id = parseInt(s.product_id);
      if (!validIds.has(id)) return null;
      const p = productMap[id];
      if (!p) return null;
      return {
        product_id: id,
        product_name: p.name,
        category: p.category,
        subcategory: p.subcategory || '',
        price: parseFloat(p.price),
        confidence: parseFloat(s.confidence || 0.75),
        reason: s.reason || '',
        similarity_score: p.similarity_score,
        in_stock: true
      };
    })
    .filter(s => s && !contextData.cart_product_ids.includes(s.product_id))
    .sort((a, b) => b.confidence - a.confidence)
    .slice(0, 5);

  if (enriched.length === 0 && contextData.compatible_products.length > 0) {
    llmUsed = 'fallback-rag';
    contextData.compatible_products.slice(0, 3).forEach(p => {
      enriched.push({
        product_id: p.id,
        product_name: p.name,
        category: p.category,
        price: parseFloat(p.price),
        confidence: 0.7,
        reason: 'Semantically similar',
        similarity_score: p.similarity_score,
        in_stock: true
      });
    });
  }

  return {
    success: true,
    suggestions: enriched,
    context_used: {
      weather: contextData.weather,
      season: contextData.season,
      rag_products_found: contextData.compatible_products.length
    },
    analytics: {
      cart_value: parseFloat(contextData.cart_total),
      suggested_value: enriched.reduce((s, p) => s + p.price, 0),
      suggestion_count: enriched.length
    },
    metadata: {
      llm_used: llmUsed,
      tier: 'enterprise',
      rag_enabled: true,
      generated_at: new Date().toISOString()
    }
  };
} catch (e) {
  return {
    success: false,
    suggestions: [],
    error: e.message,
    metadata: { tier: 'enterprise', llm_used: 'error' }
  };
}

// Store in cache
const cacheKey = $node["Check Cache"].json.cacheKey;
const requestId = $node["Check Cache"].json._requestId || 'unknown';

if (cacheKey && cacheKey !== 'unknown:unknown') {
  global.suggestionCacheEnterprise[cacheKey] = {
    data: $json,
    timestamp: Date.now(),
    request_id: requestId
  };
  delete global.processingRequestsEnterprise[cacheKey];
}

return { json: { ...$json, cached: false } };
